description:
What Lilly sees is about to change her life
 forever

 On a particularly cool and misty summer night
 Lilly is visited by an enchanted red scarf
 that sends her on an incredible adventure as
 she seeks to rescue her little brother Row
 Soon into her quest, Lilly discovers a special
 pair of goggles that allow her to solve many
 navigational challenges by rewriting the past
 and changing the present. Step into a world
 filled with magic, puzzles, and marvelous
 machines that celebrate a sense of wonder as
 you help Lilly save her brother and discover
 the ultimate mystery    
